import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import imgHeader from '../images/bg-header-desktop.svg'


const useStyles = makeStyles({
    imgHead:{
        width:'100%',
        height:'100%',
    },
    
    headerBg:{

        backgroundColor:'hsl(180, 29%, 50%)',
        height:'23px'
    }
});




export const Header = () => {

    const classes = useStyles();

    return (
        <header className={classes.headerBg}>
            <img src={imgHeader} className={classes.imgHead} alt="img-header" />
        </header>
    )
}
